import Button from "../Button"



export function ShowAdmins({adminList}) {
    return (
      <div>
        <table className="table table-striped">
                            <thead classNameName=''>
                              <tr>
                                  <th>Id</th>
                                  <th>Full Name</th>
                                  <th>Phone</th>
                                  <th>Email</th>
                                  <th>Password</th>
                                  <th>
                                  <Button
                  color=""
                  bgColor="var(--primary-color)"
                  name="Add Admin"
                  id="addAdminBtn"
                  className="btn px-4"

                />
                                  </th>

                              </tr>
                            </thead>
                              <tbody id="tableDataField">

                              {adminList.map((item)=>{
                                return(
                                <tr>
                                  <td>{item.id}</td>
                                  <td>{item.fullName}</td>
                                  <td>{item.phone}</td>
                                  <td>{item.email}</td>
                                  <td>{item.password}</td>
                                  <td>
                                  <Button
                                    color=""
                                    bgColor=''
                                    name="Edit"
                                    id={item.id}
                                    className="btn editBtn"

                                  />
                                  <Button
                                    color=""
                                    bgColor=''
                                    name="Delete"
                                    id={item.id}
                                    className="btn deleteButton btn btn-customized text-center px-5"
                                  />
                                  </td>
                              </tr>
                                )

                              })}
                              </tbody>

        </table>
        </div>

    )
  }

  // function newAdmin() {
  //   return (
  //     <div>Admins</div>
  //   )
  // }

export function adminActions() {
return (
    <div>adminActions</div>
)
  }
